import HomeContainer from "../views/pages/Home/HomeContainer";
import SuggestContainer from "../views/pages/SuggestForm/SuggestContainer";
import SuggestFormSucceed from "../views/pages/SuggestForm/SuggestFormSucceed/SuggestFormSucceed";
import CompositionsContainer from "../views/pages/Compositions/CompositionsContainer";
import ShowcaseContainer from "../views/pages/Showcase/ShowcaseContainer";
import OrderFormContainer from "../views/pages/OrderForm/OrderFormContainer";
import OrderFormSucceed from "../views/pages/OrderForm/OrderFormSucceed/OrderFormSucceed";
import ErrorPage from "../views/pages/ErrorPage/ErrorPage";

const routes = [
    {
        path: '/',
        exact: true,
        auth: false,
        component: HomeContainer
    },
    {
        path: '/suggest',
        exact: true,
        auth: true,
        component: SuggestContainer
    },
    {
        path: '/suggest/success',
        exact: true,
        auth: true,
        component: SuggestFormSucceed
    },
    {
        path: '/compositions(/:page)?',
        exact: true,
        auth: true,
        component: CompositionsContainer
    },
    // {
    //     path: '/showcase/:id',
    //     exact: false,
    //     auth: true,
    //     component: ShowcaseContainer
    // },
    {
        path: '/order/:id',
        exact: true,
        auth: true,
        component: OrderFormContainer
    },
    {
        path: '/order/:id/success',
        exact: false,
        auth: true,
        component: OrderFormSucceed
    },
    {
        path: '*',
        exact: true,
        auth: false,
        component: ErrorPage
    }
];

export default routes;
